import React, {Component} from 'react';

class Choice extends Component{

    constructor(props){
        super(props);
        this.fname = "./static/choices/" + props.cname;
    }

    options = [
        <input type="radio" name="test"></input>
    ];

    render(){
        return (
            <div className="options">
                {this.options}
            </div>
        );
    }
}
export default Choice;
